import React from 'react';
import { gql } from 'apollo-boost';
import { Query } from 'react-apollo';
import './App.css';


const prueba = () => {
    return <Query query={gql`
                {
                    brokers {
                        id
                        name
                        address
                    }
                }`
    }/>
};



function App() {
  return (
    <div className="App">
      <p>hola mundo</p>
    </div>
  );
}

export default App;
